import React from "react";
import brandIcon from "../images/blockchain.png"

export default function Nav() {
    return (
        <nav>
             <ul>
                 <li>women</li>
                 <li>men</li>
                 <li>kids</li>
             </ul>
             <img src={brandIcon} className='nav-icon' alt='icon'/>
             
        </nav>
     );
}
